import React  from 'react';
import {Text, View, Image, Button, Alert, StyleSheet} from 'react-native';

const App = () => {
    return (
        <View style = {{flex: 1, justifyContent: "center", alignItems:"center", backgroundColor: 'grei'}}>
        
            <Text style= {{fontSize: 50, color: 'blue'}}> Ovi </Text> 

        <Image
            
            source = {{uri: 'https://picsum.photos/200/200'}}
            style = {{height:150, width: 150, marginTop: 8, borderBottomRightRadius: 30, borderBottomLeftRadius: 30, borderTopLeftRadius:30, borderTopRightRadius:30}}
        />

        <Button
            onPress = {()=> Alert.alert ('Pero ponele voluntaa!!!')}
            title='Iniciar Test'
            color="blue"
            style = {{height:100, width: 120, marginTop: 20,}}
            />

        </View> 




    );
       
};

export default App;
